giM(){return"\u0938\u0942\u091a\u0940\u092e\u0927\u094d\u092f\u0947 \u090f\u0915 \u092c\u0945\u0928\u0930 \u092a\u094d\u0930\u0926\u0930\u094d\u0936\u093f\u0924 \u0915\u0930\u0924 \u0906\u0939\u0947"},
