gm6(){return"\u092e\u091c\u0915\u0941\u0930\u093e\u091a\u0947 \u092c\u091f\u0923 \u0926\u093e\u092c\u0932\u094d\u092f\u093e\u0935\u0930 \u0924\u0947 \u0936\u093e\u0908 \u0909\u0921\u0935\u0924\u093e\u0928\u093e \u0926\u093e\u0916\u0935\u0924\u0947 \u092a\u0923, \u0924\u0947 \u0935\u0930 \u0909\u091a\u0932\u0924 \u0928\u093e\u0939\u0940. \u091f\u0942\u0932\u092c\u093e\u0930, \u0921\u093e\u092f\u0932\u0949\u0917\u092e\u0927\u094d\u092f\u0947 \u0906\u0923\u093f \u092a\u0945\u0921\u093f\u0902\u0917\u0938\u0939 \u0907\u0928\u0932\u093e\u0907\u0928\u092e\u0927\u094d\u092f\u0947 \u092e\u091c\u0915\u0941\u0930\u093e\u091a\u0940 \u092c\u091f\u0923\u0947 \u0935\u093e\u092a\u0930\u093e"},
