gdE(){return"\u0906\u0909\u091f\u0932\u093e\u0907\u0928\u094d\u0921 \u092c\u091f\u0923"},
gkX(){return"\u0906\u0909\u091f\u0932\u093e\u0907\u0928\u094d\u0921 \u092c\u091f\u0923\u0947 \u0926\u093e\u092c\u0932\u094d\u092f\u093e\u0928\u0902\u0924\u0930 \u0905\u092a\u093e\u0930\u0926\u0930\u094d\u0936\u0915 \u0939\u094b\u0924\u093e\u0924 \u0906\u0923\u093f \u0935\u0930 \u0909\u091a\u091a\u0932\u0940 \u091c\u093e\u0924\u093e\u0924. \u090f\u0916\u093e\u0926\u0940 \u092a\u0930\u094d\u092f\u093e\u092f\u0940, \u0926\u0941\u0938\u0930\u0940 \u0915\u094d\u0930\u093f\u092f\u093e \u0926\u093e\u0916\u0935\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u0924\u0947 \u0938\u0939\u0938\u093e \u0909\u0902\u091a \u092c\u091f\u0923\u093e\u0902\u0938\u094b\u092c\u0924 \u091c\u094b\u0921\u0932\u0940 \u091c\u093e\u0924\u093e\u0924."},
gdV(){return"\u091f\u0949\u0917\u0932 \u092c\u091f\u0923\u0947"},
gmm(){return"\u0938\u0902\u092c\u0902\u0927\u093f\u0924 \u092a\u0930\u094d\u092f\u093e\u092f\u093e\u0902\u091a\u0940 \u0917\u091f\u093e\u0902\u092e\u0927\u094d\u092f\u0947 \u0935\u093f\u092d\u093e\u0917\u0923\u0940 \u0915\u0930\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u091f\u0949\u0917\u0932 \u092c\u091f\u0923\u0947 \u0935\u093e\u092a\u0930\u0932\u0940 \u091c\u093e\u090a \u0936\u0915\u0924\u093e\u0924. \u0938\u0902\u092c\u0902\u0927\u093f\u0924 \u091f\u0949\u0917\u0932 \u092c\u091f\u0923\u093e\u0902\u091a\u094d\u092f\u093e \u0917\u091f\u093e\u0902\u0935\u0930 \u0932\u0915\u094d\u0937 \u0915\u0947\u0902\u0926\u094d\u0930\u0940\u0924 \u0915\u0930\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u092a\u094d\u0930\u0924\u094d\u092f\u0947\u0915 \u0917\u091f\u093e\u092e\u0927\u094d\u092f\u0947 \u090f\u0915 \u0938\u092e\u093e\u0928 \u0918\u091f\u0915 \u0905\u0938\u0923\u0947 \u0906\u0935\u0936\u094d\u092f\u0915 \u0906\u0939\u0947"},
gbE(){return"\u092b\u094d\u0932\u094b\u091f\u093f\u0902\u0917 \u0972\u0915\u094d\u0936\u0928 \u092c\u091f\u0923"},
gkl(){return"\u0972\u092a\u094d\u0932\u093f\u0915\u0947\u0936\u0928\u092e\u0927\u094d\u092f\u0947 \u092a\u094d\u0930\u093e\u0925\u092e\u093f\u0915 \u0915\u094d\u0930\u093f\u092f\u093e \u0915\u0930\u0923\u094d\u092f\u093e\u091a\u0947 \u0938\u0942\u091a\u093f\u0924 \u0915\u0930\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u0906\u0936\u092f\u093e\u0935\u0930 \u092b\u093f\u0930\u0923\u093e\u0930\u0947 \u092b\u094d\u0932\u094b\u091f\u093f\u0902\u0917 \u0972\u0915\u094d\u0936\u0928 \u092c\u091f\u0923 \u0939\u0947 \u0917\u094b\u0932\u093e\u0915\u093e\u0930 \u0906\u092f\u0915\u0928 \u092c\u091f\u0923 \u0906\u0939\u0947."},
